import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  entities: { IDSRV: "", NAME: "", CITY: "", PHONE: "", FRAN_NAME: "" },
};

export const onjectFilterSlice = createSlice({
  name: "objectFilter",
  initialState,
  reducers: {
    setFilter: (state, action) => {
      const {entities, filter} = action.payload;
      console.log(entities, filter)
      // return {
      //   [filter]: entities
      // };
    },
    resetFilter: () => {
      return {
        initialState,
      };
    },
  },
});

export const onjectFilterSliceActions = onjectFilterSlice.actions;
